import Header from './Header'
import Footer from './Footer'

export default function Layout(props) {
    return (
        <div id="header">
            <div className="Header">
                <Header />
            </div>
            <div style={bodyStyle}>
              {props.children}
            </div>
            <div className="Footer" style={footerStyle}>
            <Footer />
            </div>
            <style jsx>{`
              header {
                  width: 100%;
                  border: 1px solid;
              }

              layout {
                margin: 20,
                padding: 20,
                flex: 1,
              }

              body {
                border: '1px solid #DDD',
                display: 'flex',
                flexdirection: 'column',
                minheight: '100vh',
            
            `}
            </style>
        </div>
    )
}
